const particlesOptions = {

  particles: {
    line_linked: {
      shadow: {
        enable: true,
        color: blue,
        blur: 5
      }
    }
  }
}




const App = () => (

  <div className='App'>

    <Particles className='particles' params={particlesOptions}/>

    <Tetris />



  </div>


);

export default App;
